import React from 'react';
import {withRouter} from 'next/router';
import axios from 'axios';


export default class User extends React.Component{

    constructor(props){
        super(props);
        this.state = {form:{}}; 
        this.handleChange = this.handleChange.bind(this);
        this.handleSubmit = this.handleSubmit.bind(this);
    }
    handleChange(even){
        let {form} = this.state;
        const name = even.target.name;
        const value = even.target.value;
        form[name] = value;
        this.setState({
            form
        }); 
    }
    handleSubmit(event){
        event.preventDefault();
        let {form} = this.state;
        console.log(form,'==================??data')
        axios.post('http://localhost:3333/user/add',{form})
        .then(res => {
            console.log(res);
            console.log(res.data);
          })
    }
    componentDidMount(){
        let {form} = this.state;
        console.log(form,'==================??data')
        axios.post('http://localhost:3333/user/add',{form})
        .then(res => {
            console.log(res);
            console.log(res.data);
          })
    }
    render(){
        return(
            <div>
                <form  method='post' encType="multipart/form-data" onSubmit={this.handleSubmit} >
                    <div className="form-group">
                        <label  >User name</label>
                        <input name="name" className="form-control" onChange={this.handleChange} /> 
                    </div>
                    <div className="form-group">
                        <label  >Email </label>
                        <input type="email" name="email" className="form-control" onChange={this.handleChange}/> 
                    </div>
                    <div className="form-group">
                        <label  >Password </label>
                        <input name="password" type="password" onChange={this.handleChange} className="form-control" /> 
                    </div>
                    <button type="submit" className="btn btn-primary">Submit</button>
                </form>
            </div>
        )
    }
}
